import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import PropTypes from 'prop-types';

const App = () => {
  useEffect(() => {
    const getCards = async () => {
      let res = "";
      try {
        const data = axios.get('https://api.pokemontcg.io/v1/cards?pageSize=10')
        .then(function (response){
          res = response.data.cards;
          console.log('res', res);
        });
        console.log('res', res);
      } catch (err) {
        console.error(err);
      }
    };
    getCards();
  }, []);
  return (
    <div>
      <h1>Pokemon Cards rarity</h1>
    </div>
  );
}

export default App;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
